pragma solidity ^0.8.0;

contract PoliceCaseManagement {
    struct CaseData {
        bytes32 firNumber;
        bytes32 evidenceHash;
        bytes32 forensicsHash;
        string caseStatus;
        uint256 timestamp;
        bool isActive;
    }

    mapping(bytes32 => CaseData) public cases;

    event CaseCreated(bytes32 firNumber, uint256 timestamp);
    event CaseUpdated(bytes32 firNumber, string caseStatus, uint256 timestamp);

    function createCase(
        bytes32 _firNumber,
        bytes32 evidenceHash,
        bytes32 forensicsHash,
        string memory caseStatus
    ) public {
        require(cases[_firNumber].firNumber == bytes32(0), "Case already exists");
        cases[_firNumber] = CaseData(
            _firNumber,
            evidenceHash,
            forensicsHash,
            caseStatus,
            block.timestamp,
            true
        );
        emit CaseCreated(_firNumber, block.timestamp);
    }

    function updateCaseStatus(bytes32 _firNumber, string memory caseStatus) public {
        require(cases[_firNumber].firNumber != bytes32(0), "Case not found");
        require(cases[_firNumber].isActive, "Case is closed");
        CaseData storage c = cases[_firNumber];
        c.caseStatus = caseStatus;
        emit CaseUpdated(_firNumber, caseStatus, block.timestamp);
    }

    function closeCase(bytes32 _firNumber) public {
        require(cases[_firNumber].firNumber != bytes32(0), "Case not found");
        require(cases[_firNumber].isActive, "Case is already closed");
        CaseData storage c = cases[_firNumber];
        c.isActive = false;
        c.caseStatus = "Closed";
        emit CaseUpdated(_firNumber, "Closed", block.timestamp);
    }

    function getCase(bytes32 _firNumber)
        public
        view
        returns (
            bytes32 fir,
            bytes32 evidence,
            bytes32 forensics,
            string memory status,
            uint256 timestamp
        )
    {
        require(cases[_firNumber].firNumber != bytes32(0), "Case not found");
        CaseData memory c = cases[_firNumber];
        return (
            c.firNumber,
            c.evidenceHash,
            c.forensicsHash,
            c.caseStatus,
            c.timestamp
        );
    }
}
